import { defineStore } from 'pinia'
import { ref, Ref } from 'vue'

// TODO : read server URL from config instead
const SERVER_URL = 'https://backend.supercoop.fr/send-email'

export const useInboundStore = defineStore('orders', () => {
  const orders: Ref<Map<string, InboundOrder> | undefined> = ref()

  async function getOrders() {
    // TODO : replace this with AXIOS request and include access token
    const jsonOrders: Array<any> = await new Promise((resolve) =>
      setTimeout(() => {
        resolve([
          {
            po: 'PO13311',
            provider: 'Brasserie du Sabot BSA',
            date: new Date('10/09/2025 14:09:52'),
            products: [
              {
                barcode: '0420000019879',
                name: 'Brasserie du Sabot Ambrée Emma Goldman 33cl BSA',
                image:
                  'data:image/png;base64,',
                parcels: 2,
                packSize: 24,
              },
              {
                barcode: '0420000019893',
                name: 'Brasserie du Sabot Blonde Louise Michel 33cl BSA',
                image:
                  'data:image/png;base64,',
                parcels: 1,
                packSize: 24,
              },
              {
                barcode: '0420000019886',
                name: 'Brasserie du Sabot IPA Rosa Luxembourg 33cl BSA',
                image:
                  'data:image/png;base64,',
                parcels: 2,
                packSize: 24,
              },
            ],
          },
          {
            po: 'PO13066',
            provider: 'Brasserie Effet Papillon BEP',
            date: new Date('07/31/2025 15:51:17'),
            products: [
              {
                barcode: '3760368421240',
                name: 'Effet Papillon Pale Ale Francaise BIO 75cl BEP',
                image:
                  'data:image/png;base64,',
                parcels: 3,
                packSize: 6,
              },
              {
                barcode: '3760368421226',
                name: 'Effet Papillon Pils Française BIO 75cl BEP',
                image:
                  'data:image/png;base64,',
                parcels: 4,
                packSize: 6,
              },
              {
                barcode: '3760368421257',
                name: 'Effet Papillon India Pale Ale BIO 75cl BEP',
                image:
                  'data:image/png;base64,',
                parcels: 2,
                packSize: 6,
              },
              {
                barcode: '3760368421264',
                name: 'Effet Papillon New England IPA BIO 75cl BEP',
                image:
                  'data:image/png;base64,',
                parcels: 5,
                packSize: 6,
              },
              {
                barcode: '3760368421233',
                name: 'Effet Papillon Wheat Ale Citron 75cl BEP',
                image:
                  'data:image/png;base64,',
                parcels: 1,
                packSize: 6,
              },
            ],
          },
        ])
      }, 1000),
    )

    orders.value = new Map(
      jsonOrders.map((order) => [
        order.po,
        {
          ...order,
          products: new Map(
            order.products.map((product: InboundProduct) => [product.barcode, product]),
          ),
        },
      ]),
    )

    return orders.value
  }

  async function getOrder(po: string) {
    if (!orders.value) {
      await getOrders()
    }

    return orders.value?.get(po)
  }

  async function getProduct(po: string, barcode: string): Promise<InboundProduct | undefined> {
    if (!orders.value) {
      await getOrders()
    }

    return orders.value?.get(po)?.products.get(barcode)
  }

  async function productCountValid(po: string, barcode: string) {
    const product = orders.value?.get(po)?.products?.get(barcode)
    if (!product) throw new Error('product not found')
    product.inbound = { ok: true }
  }

  async function productCountError(po: string, barcode: string, received: number, comment: string) {
    const product = orders.value?.get(po)?.products?.get(barcode)
    if (!product) throw new Error('product not found')

    product.inbound = { ok: false, received, comment }
  }

  async function sendOrder(po: string) {
    const order = orders.value?.get(po)
    if (!order) throw new Error('Order not found')

    // TODO : replace this with AXIOS request and include access token
    const response = await fetch(SERVER_URL, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      // body: JSON.stringify({
      //   zone,
      //   products: products.value.values(),
      // }),
    })
    return await response.json()
  }

  return {
    orders,
    getOrders,
    getOrder,
    getProduct,
    productCountValid,
    productCountError,
    sendOrder,
  }
})
